import React from "react";
import "../CSS/Profil.css";
import TweetList from "../JS/TweetList";

function Profil({email, firstName, lastName, _id}) {

    return <div className="Profil">
        <div className="top" style={{border: 'none'}}>
            <div className="profil">
                <p>{firstName}</p>
                <p>{lastName}</p>
            </div>
        </div>
        <div className="choiceCategorie">
            <div className="tweetChoice choicePart">Tweets</div>
            <div className="likeChoice choicePart">J'aime</div>
        </div>
        <TweetList email={email} _id={_id} mode='profilTweets'></TweetList>
    </div>;
}
export default Profil;
